import React from 'react';

const Square = (props) => {

    return(
        <div
            onClick = {props.onClick}
            style = { { 
                display : "flex",
                border : "1px solid black",
                height : "100px",
                width : "100%",
                justifyContent : "center",
                alignItems : "center",
             } }
             className='square'
             >

            <h5> {props.value} </h5>

        </div>
    )
};

export default Square;
